INSERT INTO `faq` (`index`, `question`, `answer`) VALUES
(1, 'מהם איזורי הפעילות שלך?', 'מנתניה בדרום עד חיפה בצפון.'),
(2, 'מהו המיקום הרצוי להופעת יום הולדת?', 'ההופעה יכולה להתקיים בתוך דירה, או בגינה.\r\nאם ההופעה מתקיימת בגינה בשעות היום, יש לדאוג למקום מוצל.'),
(3, 'האם מותר לצלם את ההופעה בוידאו?', 'כן!'),
(4, 'מהו הכיבוד המומלץ להופעת יום הולדת?', 'על מנת למנוע לכלוך ובלגן, מומלץ להכין מראש צלחות אישיות, ושקיות "טרופית" לשתיה.'),
(5, 'האם אתה מחלק פרסים והפתעות?', 'בסוף האירוע כל ילד מקבל קסם מדהים במתנה. פרסים לא מחולקים בזמן ההופעה, על מנת למנוע קנאה בין הילדים.'),
(6, 'האם אתה מביא מערכת הגברה ומוסיקה?', 'כן. מערכת ההגברה כוללת מצבר - אין צורך לדאוג לנקודת חשמל.');
