INSERT INTO `reasons` (`index`, `value`) VALUES
(1, 'הופעת קסמים איכותית, ייחודית, מפתיעה ושונה. הילדים מוזמנים לעולם של פנטזיה ומסתורין, בו דמויות המתעוררות לחיים, ומסייעות ליאגו לקסום קסמים.'),
(2, 'הופעה מלאה בהומור. הקסמים מתרחשים מעצמם ללא שליטה. יאגו משתתף בחוויה עם הילדים, והם מתגלגלים מצחוק. אין בדיחות על חשבון המתנדבים או קסמים העלולים להביכם.'),
(3, '\r\nילדכם הוא כוכב ההופעה ושותף לרוב הקסמים. זו ההזדמנות שלו לבטא את עצמו. גם אם הוא מתבייש להשתתף באופן פעיל, חלק מהקסמים עוסקים בו וביום הולדתו.'),
(4, 'האורחים שותפים אף הם למופע, בקטע הסיום לפחות 15 ילדים מבצעים בעצמם רצף קסמים מהירים ומרהיבים.'),
(5, 'כל ילד מקבל הפתעה ייחודית - קסם מדהים אותו הוא יכול להציג בעצמו בקלות (חוסך את עלות השקיות וההפתעות).'),
(6, 'אין קסמים מסוכנים או מפחידים. המשלבים חרבות, סכינים או אש.'),
(7, 'יאגו הקוסם מקפיד לדבר בשפה יפה וגבוהה, ללא מילים ובדיחות גסות.'),
(8, '\r\n"חברים דמיוניים" מתעוררים לחיים ועוזרים ליאגו לשעשע את הילדים. אין חיות במופע, מסיבות של "צער בעלי חיים".'),
(9, 'ההופעה מותאמת לגיל הילדים - הקטנים יהנו מקסמים ויזואליים ופשוטים להבנה. הבוגרים יחוו גם קסמי טלפתיה וטלקינזיס (הזזת חפצים בכח המחשבה).'),
(10, 'בחלק השני של האירוע מעביר יאגו סדנת קסמים לילדים הבוגרים, הקטנים יותר פוגשים את "ספי הספר" בשעת סיפור משעשעת.');
INSERT INTO `recommendations` (`index`, `name`, `recommendation`, `approved`, `email`, `phone`, `ip`, `referrer`, `timestamp`, `remotehost`, `remoteport`, `useragent`, `full_string_info`) VALUES
(1, 'מלון דן קיסריה', 'הנדון: הופעות קיץ 2007<br /><br />אני מבקשת להודות לך בשמי ובשם אורחינו על קיץ קסום של הופעות. <br /><br />הופעת הקסמים שלך ייחודית, מקורית ורב גונית. אני מעריכה במיוחד את יכולתך להתאים את תוכן ההופעה ואופיה לקהל הנמצא באותו ערב מולך – קסמים ויזואליים  לילדים, קטעי טלפתיה לקהל מבוגר ו\\"תרגום\\" לאנגלית לטובת תיירינו.<br />הופעותיך התאימו מאד לקהל אורחינו שמגיע מרחבי הארץ והעולם, חילוניים ודתיים. <br />בזכות הויזואליות המרשימה, התלבושת הייחודית ו\\"חבריך\\" הססגוניים הצלחת לעניין ולבדר גם קהל שאינו דובר עברית.<br />רמת הקסמים וההופעה תואמת את המוניטין הגבוה של מלון דן קיסריה ואת רצוננו להגיש בידור איכותי לאורחינו.<br />כמו כן ברצוני להודות לך על תרומתך להצלחת יום הכיף שאורגן עבור עובדי המלון.<br /><br />בברכה,<br />לילי גבעולי - מנהלת אירועים ויחסי ציבור <br />מלון דן קיסריה', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(2, 'ביטוח לאומי סניף נתניה', 'יאגו הקוסם!<br /><br />תתגמדנה המילים ותקצר היריעה <br />להביע לך מילות הערכה<br />על תשומת הלב האישית והחמה<br />על הרצון הטוב ועל כל העזרה.<br />לכל אחד יש את היום המיוחד שלו<br />ואתה היית חלק מהיום המיוחד שלנו.<br />חלק מיום שבו הצלחנו יחדיו להעלות<br />חיוך מיוחד על פניהם של ילדים יתומים<br />ולהכניס קרן אור נוספת לחייהם.<br />תודה על שפעלת רבות עם המון אהבה<br />ואכפתיות להגשמת החלום.<br /><br />הנהלת סניף נתניה וצוות "עם הפנים לקהילה" ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(3, 'ענבל סיוון', 'חגגנו יום הולדת 6 לאורי. היה מקסים. הילדים נהנו מאוד ולא הפסיקו לצחוק. לאחר מכן שמענו חויות מהורי הילדים שצינו שהילדים כל כך נהנו ומזמן לא היה יום הולדת כיף כזה.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(4, 'מירי', 'יאגו הקוסם הצליח לרתק כ-40 ילדים בני 3-8 שהשתתפו ביום ההולדת של בני בן ה- 4 וגם את ההורים.<br />לשמחת ההורים המופע מתקיים בווליום סביר, כך שהם יכלו להשאר ולדבר בכיף.<br />כל בקשה שהפנינו ליאגו הקוסם במהלך המופע התקבלה בברכה ובשיתוף פעולה מלא.<br />המלצתנו החמה- המופע נעים, מיוחד, זורם, מושקע.<br />לאורך כל יום ההולדת יאגו הקוסם היה שם בשבילנו, ולא הפסיק להפתיע בהפעלות מיוחדות...<br /><br /> ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(5, 'אביטל פ.', 'הייתה הופעה מקסימה ומהנה לכולם. המון תודה על הכל.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(6, 'דרור ערמון', 'מאד מקצועי, מהנה ומאשיר. הילדים מרותקים', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(7, 'ענתי', 'חגגנו יומולדת 6 בהנחייתו הנפלאה של יאגו.<br />היה מקסים וכל הנוכחים (קטן גם גדול) נהנו מאוד. יאגו הגיע לפני הילדים כדי להתכונן וגם כדי לקבל את פני המגיעים. העסיק אותם עד שכולם באו ואז התחיל במופע. הילדים התגלגלו מצחוק מחבריו של יאגו.<br />אחרי אתנחתא לעוגה - יאגו המשיך בהפעלת הילדים במשחקים וקסמים, עד ללכתו של אחרון הזאוטוטים. מאחורי המופע של יאגו יש בן אדם מקסים ואני ממליצה עליו בחום. חשוב לציין את הערך המוסף: 0 עבודה להורים, חוץ מהכנת עוגה וניפוח בלונים לקישוט. ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(8, 'נוגה', 'יאגו נותן הופעה חכמה ומצחיקה. הצליח לרתק חבורת ילדים די גדולה וחוגגת...<br />כל הכבוד. גם המחיר הוגן.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(9, 'זוהרה', 'יאגו ערך בביתנו מסיבת יום הולדת בה השתתפו<br />כ-30 ילדים בני 8 שישבו מרותקים במשך שעתיים<br />שלא לדבר עלינו המבוגרים,שנהנינו מכל רגע... <br />שווה כל שקל ומומלץ בחום לכל הגילאים!!!<br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(10, 'יעל ואלון', 'יאגו היה ביום הולדתה ה- 8 של בתנו. הילדים בהחלט נהנו, אך במיוחד רציתי לציין את היחס הרציני והמכבד שלו אליהם, מה שלא קיים אצל הרבה "מפעילים". יש לו הרבה סבלנות, הוא נשאר מעבר לזמן הנדרש, למד והראה לילדים שוב ושוב קסמים. בקצור נהננו. ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(11, 'הדס ודרור', 'ממליצים בחום על יאגו - אדם וקוסם נהדר!<br />יאגו הופיע אצל שני הילדים שלנו בימי ההולדת (גילאי 4~6) והיה פשוט נפלא, פעמיים:<br />יאגו יודע להתחבר לילדים, לעניין אותם ולתת לילד החוגג יום הולדת הרגשה באמת מיוחדת ע"י שיתופו במופע. המופע זורם ללא קללות, מילים גסות, בעלי חיים מנותילם, הפחדות או צחוק ע"ח הילדים - מופע תרבותי ברמה גבוהה.<br />מעבר לזה, יאגו טיפוס נעים, מדייק בזמנים, ופשוט מספק את הסחורה המובטחת - כיף להעביר איתו את האירוע. בקיצור מומלץ.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(12, 'hagben', 'ביום הולדתה של ביתנו הזמנו, למזלנו יש לומר, את "יאגו הקוסם".<br />הופעתו של יאגו עם חבריו/ תיו הבובות גרמו לילדים וגם למבוגרים שבנינו להיות מרותקים למופע.<br />ברגישות והמון סבלנות לקהל הוא ניגש וסחף אותנו עם פעלוליו.<br />ממליצים בחום ומודים שוב על המופע הקסום !!!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(13, 'שרון כלנית', 'הזמנתי את יאגו למסיבת יום ההולדת של בתי חן בת ה-9. מאוד חששתי מאחר וגיל 9 הוא גבולי לפעילויות של ימי הולדת. גם הילדים בתחילה לא התלהבו מכך שיש קוסם.<br />כל חששותיי נעלמו מיד כאשר יאגו החל את הפעילות, הילדים היו מוקסמים מיאגו, למחרת היום קיבלתי טלפונים מהמון אמהות שסיפרו שהילדים לא הפסיקו לדבר עליו בהתלהבות. <br />ואכן מסתבר שאפשר עדיין להלהיב גם את הילדים בגילאיים הגדולים יותר ויאגו הוכיח לי את זה. אני ממליצה בחום, הפעילות היתה נהדרת, ההפתעות מרהיבות, ומעל הכל הגישה, השפה והיחס של יאגו מדהימים.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:26', NULL, NULL, NULL, NULL),
(14, 'עדי', 'הזמנו את יאגו להופעתו ליום הולדת בננו בן ה6. הוא הגיע לפני הזמן , חיכה לילדים והחל לעשות להם קסמים עד שכולם הגיעו ואז החל בהופעתו. הוא היפנט את הילדים ולא בזיקוקים ורעש אלא בהומור וקסמים מותאמים בדיוק לילדים. היה סובלני מאוד ונראה כי הוא בעל נסיון רב בעבודה עם ילדים. מומלץ בחום!!!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(15, 'נטלי', 'ממליצה  מאוד. היה כיף וילדים נהנו מאוד.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(16, 'יעל', 'ממליצה בחום. <br />חגגנו יום הולדת 5 לתאומים עם משפחה וחברים. הילדים בגילאי 2 עד 7 וכן ההורים הוקסמו, צחקו ונהנו.  יאגו משתף את החוגגים באופן נעים מאוד, ומרתק באמצעות קסמים והומור.<br />יאגו הקדים, קיבל את האורחים, והמשיך לעניין ולהקסים גם אחרי המופע המרכזי. <br />נהננו מאוד.<br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(17, 'רותי ישפה זיו', 'יאגו הקוסם ערך את יום ההולדת של שני אחייני, ההופעה היתה נהדרת יאגו מדבר לילדים בגובה העיניים ומבצע קסמים מעיינים הדורשים רמת גבוהה מאוד.<br />הילדים וילדי היומולדת היו מרותקים  וישבו כל זמן המופע בלי לקום או להרעיש.<br />יאגו משתף ילדים במופע ועושה זאת בקסם ובחן. נהנו ממנו כאדם וכקוסם מאוד.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(18, 'לימור ', 'חיפשתי קוסם רגוע, חייכן, שאינו מביא מוזיקה בקולי קולות, שאינו מנסה לשעשע את הההורים על חשבון הילדים, שאינו משתמש בחיות, שמדבר עיברית ללא "שגיאים", שאינו מרים את קולו, שאינו ממיע שירי פסטיגל דביקים, שמביא עימו משהו אחר.<br />הרי קוסם הוא קוסם הוא קוסם - עבור הילדים.<br />ליאגו יש את כל מה שחישפשתי ועוד יותר - אמינות, חביבות ומקצוענות.<br />הילדים וגם ההורים שנשארו - נהנו מכל רגע<br />תודה תודה<br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(19, 'ענת סייג', 'בתאריך ה-13.11 חגגנו לירין את יום הולדתו השביעי.יחד עימו חגג ילד נוסף מכיתתו.<br />יאגו הקוסם הגיע לאירוע,ואכן היפנט את 40 הילדים שישבו למולו.<br />תלמידי כיתה ב'' הקשיבו,השתתפו והוקסמו מפעילותו של יאגו.<br />זה אינו מופע קסמים שיגרתי! ליאגו יש אופן מיוחד בהצגת קסמים.הילדים השתעשעו וצחקו מהדברים שיאגו שילב בעשייתו.<br />הוא שיתף את הילדים,ונתן להם לבצע את הקסמים. הם היו מרותקים.....<br />יאגו חילק להם מקל קסמים מיוחד,ואכן הילדים חוו חוויה של ...גם אני קוסם.<br />הנני ממליצה על יאגו הקוסם ,שכן דרכו הייחודית לעולם הילד הייתה קסומה.....', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(20, 'יפעת', 'יאגו הקוסם ערך פעילות יום הולדת מקסימה לקבוצת ילדים בגילאי 6 עד 9 , ההופעה היתה מרתקת, איכותית ומגוונת. הילדים השתתפו לאורך כל הפעילות ונהנו מכל רגע.<br />המוסיקה היתה נפלאה!!<br />ממליצה בחום על המופע והפעילות של יאגו!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(21, 'לינדה', 'מאוד נהננו מהפעילות של יאגו.  בני בן ה4 וחבריו היו מרותקים ומופעמים ממופע הקסמים.  האווירה הייתה ננוחה ונעימה. כולנו היינו מאוד מרוצים!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(22, 'משפחת מצר', 'למי שמחפש מופע קסמים איכותי אנחנו ממליצים בחום רב. אין פיצוצים, אין חיות , אין רעשי רקע מיותרים - מופע קלאסי ומדהים, בנוי ומתוכנן היטב. יאגו מצליח לרתק אליו ילדים ומבוגרים כאחד לכל אורך המופע. זו כבר הפעם השניה שהזמנו את יאגו ליום ההולדת של ילדינו, וקיבלנו מחמאות מילדים והורים. אנחנו צפינו במופע ארבע פעמים לפחות, ובכל פעם נשארנו פעורי פה ותהינו - איך הוא עושה את זה? היחס האישי שלו, תשומת הלב לילדי יום ההולדת ושיתוף הילדים המוזמנים בקסמים, תוך שהוא נותן לכל ילד להרגיש שהוא קוסם -  הם המפתח לאירוע המוצלח שלכם. ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(23, 'מאשה', 'חגגנו יום הולדת לבתנו 6, בהופעה היו ילדים בני 6-12, כולם היו מרותקים. היו קטעים מצחקים. ילדים ישתתפו ונהנו.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(24, 'רוחה עמית', 'יאגו הופיע אצלנו בחגיגת יום הולדת משפחתית. היה מקסים, מהפנט ותרבותי לקטנים ולגדולים כאחד. אין לי ספק שנתראה שוב בעתיד.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(25, 'ליאת', 'הזמנו את יאגו הקוסם ליום הולדת 8 של הבן שלי עם כל ילדי הכתה. יאגו הפעיל אותם במשך כשעתיים וכולם נהנו מאוד. גם המבוגרים בקהל נהנו מהקסמים ומהמוזיקה שהתלוותה אליהם.<br /><br />מעבר למופע המרכזי, למקדימים ולמאחרים להישאר הוא עשה קסמים קטנים באופן אישי, לימד קסמים ונתן קסם מקסים בתור הפתעה. <br /><br />ההופעה משתפת את הילדים, בלי שום לחץ. ילד יום ההולדת החליט תוך כדי ההופעה עד כמה הוא רוצה להיות במרכז העניינים או לא.<br /><br />אנחנו ממליצים בחום!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(26, 'משפחת משה', 'ממליץ בחום על יאגו הקוסם .<br />זהו אירוע בר- מצוה שני במשפחתנו בו מופיע יאגו הקוסם , המופע היה מהנה ומרתק לצעירים ולבוגרים כאחד .<br />יאגו דואג לרצף ועניין לאורך כל האירוע, לא רק בזמן הופעתו וזאת בטוב טעם וכבוד.<br />אין ספק שנתראה באירועים נוספים במשפחתנו .', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(27, 'טלי שטרן', 'אני ממליצה בחום על יאגו הקוסם.<br />ערך יום הולדת לבני בן ה-6.<br />היה מקסים. כל הילדים גילו עניין ומאוד נהנו.<br />הופעתו מרתקת ומכובדת.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(28, 'דני מיכאליס', 'יאגו הופיע אצל חברים ומאד התרשמתי.<br />הזמנו אותו אלינו ובמשך שעתיים בידר את הילדים עם המון קסמים בזה אחר זה.<br />ממליץ בחום<br />דני', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(29, 'אלמוג', 'הזמנו את יאגו ליום ההולדת של בננו בן ה 5 <br />(לאחר שכבר נפגשנו עמו בעבר ביום ההולדת של בננו הבכור- שהשאירה זיכרון מצוין)<br />הבעיה היחידה היתה שהמארחת נותרה ללא ידיים עוזרות שבגלל שכל המבוגרים האחרים היו מרותקים למופע ביחד עם הילדים...   :)<br />מומלץ בחום<br /><br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(30, 'גלית אדן', 'פניתי אל יאגו בעקבות המלצת חברות, אשר הזמינו אותו קודם לכן, אל יום ההולדת של ילדם. ובהחלט, הן אני והן ילדי ואורחי, נהננו מכל רגע.<br />יאגו עניין את הילדים, הם היו קשובים בכל מהלך ההפעלה והוא הקסים אותם בזכות הגישה הנהדרת כלפיהם. <br />אשמח להמליץ עליו בכל עת.<br />                                     גלית.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(31, 'מירי', 'לאחר שבעבר הזמנו את יאגו הקוסם ליום הולדתה של ביתנו הבכורה, השבוע ערכנו את יום הולדתו ה 5 של בננו בעזרתו של יאגו שריתק את הילדים במשך כל מסיבת יום ההולדת במקצועיות רבה. הילדים וחתן החגיגה נהנו מכל רגע שהיה משופע בקסמים, הומור וטוב טעם.<br />תודה רבה.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(32, 'רעות כהן', 'פניתי ליאגו בבקשה לסייע  לילדים החוסים במרכז חירום להעביר להם מופע בחופשת הקיץ .<br /><br />עוד באותו יום יאגו חזר אליי ובשמחה נענה בחיוב להגיע!<br /><br />יאגו הקסים את הילדים והצליח לרתק אותם למשך שעה  וחצי קסומה של פעילות,{מה שלא ברור בכלל אצל ילדים מהסוג כמו שלנו..}<br /><br />יאגו הופיע בקסמים מדהימים ובהרבה הומור והצליח להגיע אל כולם למרות פער הגילאים הרחב, במיוחד נהנו הילדים מהיחס האישי שהוענק לכל  אחד ועל ההזדמנות שניתנה להם לבצע קסמים בעצמם!<br />הילדים נהנו{ ואנחנו לא פחות..}<br />ולא הפסיקו לדבר על המופע במשך כל היום והימים שאחרי ועל כך אני רוצה להודות, גם כמובן בשם הילדים!<br />תודה,תודה  תודה.<br /><br /><br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(33, 'רחלי אור', 'יאגו הוא ,קודם כל ,איש מקסים קשוב ורגיש לילדים וקוסם נהדר , מלא בהפתעות נעימות ומוצלחות, הילדים לא הפסיקו לצחוק ולהיות מרותקים, ולאחר מיכן בגן שיבחו אותו מאוד.<br />גם ההורים היו נלהבים ומוקסמים.חשוב לציין שגם הקסמים וגם הסיפורים הם מעניינים אינטליגנטים ובלי פגיעה לא בילדים לא בחיות ולא באוזניים של כולנו.<br />יואב שלנו ממש נהנה ויאגו שהבין לפני המסיבה שיואב חושש מימנו כי לא מכיר אותו, הגיע לביקור ויצר איתו קשר.<br />יואב אמר לי אחרי המסיבה , אמא איזה כיף שהוא היה במסיבה שלי, וכשאהיה קצת יותר גדול הלך לחוג קסמים!!!<br />אז שתדעו שההמלצה שלנו היא לא המצאה , היא מכל הלב , מצאנו אדם מקסים קשוב רגיש שיודע שגם הילדים הם נבונים , מתייחס אליהם בכבוד ויחד עם זאת מצחיק אותם ועושה להם קסמים נהדרים.<br />תןדה רבה לך יאגו על יום הולדת נהדרת ליואב בן ה5.<br />באהבה משפחת אור לוי.<br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(34, 'יעל', 'יאגו היה אצלנו בפעם השניה, ושוב לא הכזיב. ילדי כיתה א'' נהנו מאוד, צחקו והיו מרותקים במהלך כל המסיבה. אני רוצה להדגיש גם בפעם זו: קסמים סביר להניח שהרבה ידעו לעשות, אבל הכבוד לילדים והרצינות שיש אצל יאגו הם נדירים לדעתי. <br />מאוד מאוד מומלץ!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(35, 'אמילי', 'הזמנו את יאגו למסיבת יום הולדת של בנינו בן 7 ובנינו בן 4. משימה לא פשוטה להחזיק קהל בגילים שונים, אבל יאגו הצליח בגדול! כולם נהנו גם ילדי כיתה ב'', גם ילדי גן טרום חובה וגם הורים.<br />תודה רבה.<br />ממליצה בחום!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(36, 'יהודית', 'תודה על יומולדת קסום. המבוגרים, הילדים נהנו פה אחד. יאגו, מעבר לקסמים ולהופעה, העניק יחס אישי לכל ילד. העביר אירוע ברמה והוכיח שאפשר לשעשע ולהצחיק גם בעיברית גבוהה ונכונה.<br />תודה', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(37, 'אירנה', 'הזמנו את יאגו הקוסם לחגיגת יום ההולדת של הילדים שלנו בני 6. הוא הגיע בדיוק בזמן, חיכה בסבלנות עד שכל האורכים הגיעו ובנתיים הראה קסמים לאלה שהקדימו. המופע היה יפלא במשך שעתיים עם הפסקה באמצע. הילדים צחקו המון ובסוף אמרו: "כן, זה קוסם אמתי!" גם המבוגרים קיבלו כמה טיפים על קסמים מגניבים. המון המון תודה ליאגו הקוסם! מומלץ מכל הלב!!!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:27', NULL, NULL, NULL, NULL),
(38, 'sagit', 'קוסם ומפעיל מדהים !<br />יאגו ריתק והקסים את ילדי גן החובה בני ה-5-6 במשך שעתיים בצורה מופלאה ונהדרת.<br />הקסמים והתכניים מאוד מובניים ומרתקים ,הילדים התנתקו מההורים ונכנסו לעולם שכולו קסם והומור.<br />בני שחגג יום הולדת היה כוכב ליום אחד , <br />ממליצה בחום , נוכחותו של יאגו חבריו וקסמיו הפכו את יום ההולדת למאורע מאוד מוצלח שדובר רבות גם  לאחר יום ההולדת הן מבחינת ההורים שליוו את ילדיהם שהשתתפו וגם הילדים שנהנו וצחקו.<br />חשוב לומר שיאגו זרם עם הקצב של הילדים בנינוחות רבה לכן המופע זרם והילדים חשו כחלק מחוויה ולא כחלק מהפעלה.<br />יאגו תודה לך !<br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(39, 'אגם הרוש', 'ביום שבת האחרון חגגנו לאגם יום הולדת 7, אגם רצתה שנזמין קוסם ולנו היה חשוב להזמין קוסם שיהיה נעים לילדים , מקצועי, שידבר בצורה יפה ויתן מקום לאגם ויאגו עשה זאת בגדול. <br />אנחנו מאוד ממליצים הילדים ממש נהנו.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(40, 'כרמית', 'הזמנו את יאגו אלינו הביתה בפעם השלישית (!!) לחגוג למעין בת ה-5 יומהולדת (בפעמיים הקודמות הפעיל ימי הולדת של אחיה הבכור). הילדים (גן חובה בני 5-6) היו מוקסמים ומרותקים. יאגו נתן למעין את ההרגשה שהיא נסיכת השמחה ומסמר האירוע, אך עם זאת הצליח להתייחס באופן אישי לכל אחד מהאורחים האחרים (וכן לאח הבכור). מעין היתה מאושרת וכל אורחיה הקטנים היו מרוצים.<br />אנחנו ממליצים בכל פה. היומהולדת היתה מאוד מוצלחת.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(41, 'שרית כהן', 'בעקבות ההמלצות החמות באתר זה,יצרתי קשר טלפוני עם יאגו הקוסם וכבר בשיחת הטלפון הרגשתי שמדובר באישיות נעימה, ומקצועית.לא היה לי ספק שזה הבנאדם שאותו אקח לאירוע שלי.<br />יום ההולדת של בני בן ה-6 התנהל בצורה מדהימה מהשניה הראשונה שחבורה של 25 ילדי גן נכנסו בריצה אלינו הבייתה.היה מרתק,מצחיק מאוד,מקורי,כיף להורים ולילדים כאחד.הבן שלי היה מאושר.הילדים היו מרותקים מהרגע הראשון עד הרגע האחרון.בקיצור לא צריך להתלבט..תזמינו את יאגו לאירוע שלכם ותהנו מכל רגע.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(42, 'מיכל   מזיכרון יעקב ', 'ביום שבת חגגנו לבתנו יום הולדת 5  הילדים המוזמנים היו בני 3.5 - 5 ילדים שמעולם לא ראו קוסם. הם ישבו מהופנטים במשך שעה והיו מוכנים לשבת גם שלוש שעות,  הם צחקו המון, השתתפו , ענו ליאגו ושיתפו פעולה לרגע לא השתעממו.<br />הקסמים היו מיוחדים ומתאימים לגיל הצעיר, ילדים בגיל הזה עלולים להיבהל מקוסמים וכאן הילדים פשוט הוקסמו ולא רק הילדים ישבו בביתנו שורת אמהות שכל כך נהנו מהמופע.  מומלץ בחום ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(43, 'משפחת יוסף- פתח תיקווה', 'מומלץ מאוד ! ביום שישי חגגנו יום הולדת לתאומות טל ומיה <br />לכמעט 50 ילדים בני 7 שתי כיתות א'',הם לא הפסיקו לצחוק והיו מרותקים,<br />הסיפורים נהדרים ,ההפעלות הקסמים והיחס האישי לכל ילד פשוט חוויה לילדים.<br />ההופעה מועברת בשפה יפה ותקנית עם הרבה כבוד לילדים . <br />צריך לראות את הילדים נפרדים מיאגו כדי להבין איך בשעתיים הוא נכנס להם ללב <br /><br />בתחילת הערב ,חבר אמר לי הקוסם שהזמנתם נראה כמו איש הייטק – בסוף הערב הוא<br />ניגש ללחוץ ליאגו את היד והודה לו במילים חמות – המון תודה אני בוטח שנפגש בעתיד <br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(44, 'רונית גורן', 'ביום שבת האחרון ב-12.3.2011 חגגנו יום הולדת 6 עם יאגו הקוסם, יום הולדת באמת קסום... מלא הפתעות הילדים היו כמו תחת כישוף, מהופנטים, קשובים ושיתפו פעולה, גם ההורים היו מוקסמים. אין ספק שהאדם אמן, מספק לא רק קסמים מרהיבים, אלא מופע של המון דמויות קסומות , אביזרים חיצוניים מרשימים, לא להאמין שזה מופע של אדם אחד!! מומלץ בחום!!! לא לוותר על ההפתעה שהוא מספק....אפשר שתעלה איתם לכיתה א'' ותרתק אותם!! מערכת החינוך זקוקה נואשות לאנשים שלווים כמוך!! תודה רונית', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(45, 'עמית', 'ממליץ בחום. אדם מקסים ונעים הליכות שהצליח להפנט 30 ילדים בגיל גן חובה במשך שעתיים (עם הפסקת אוכל באמצע). הופעה מגוונת ומרתקת גם למבוגרים, עם יחס אישי לכל הילדים תוך שימוש בהומור, וחשוב לא פחות - שפה  עשירה ותקנית.<br />הילדים השתתפו, צחקו רקדו והוקסמו. פשוט כל הכבוד!!!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(46, 'נעמה ', 'תודה רבה ליאגו הקוסם על הופעה מקסימה ומרתקת, לבני בן ה-5 לחבריו ולבני המשפחה. ההופעה מעניינת ומשעשעת ואפילו המבוגרים נהנו ממנה מאוד. היחס היה אישי ונעים, יאגו התאים את הקסמים לגיל הילדים ואחרי ההופעה נתן הדרכה אישית לנערות שגילו עניין וביקשו לדעת עוד. כל-הכבוד ותודה רבה !', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:28', NULL, NULL, NULL, NULL),
(47, 'משפחת יפה - חיפה', 'הגענו אל יאגו בעקבות המלצה של חברים ולא התאכזבנו. בתנו חגגה יום הולדת 7 עם בני כתתה ויאגו היה פשוט מקסים. הוא שבה את לב הילדים מההתחלה, שילב קסמים עם הומור, כל זאת מבלי צורך להפעיל רעש וצלצולים מיותרים. הילדים נהנו מאד וישבו מרותקים במשך כל ההופעה. ממליצים בחום !!!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(48, 'לימור צינסקי פרץ', 'יאגו היקר,<br />זאת לא הפקה ראשונה שלנו יחד, ייאמר לזכותך שיש לך היכולת להפנט את הילדים, בלי רצון להרשים את ההורים. כך באופן מפתיע, גם אנו ההורים, נשבים לקסמייך, תרתי משמע. יאגו, תודה רבה אישית על שתרמת את חלקך, באירוע יוצא דופן, יחיד מסוגו שהפקתי ביקנעם - אגדות וכיופים בפארק. אני תקווה שהפקה ראשונה זאת תהא מסורת. מסורת שגם אתה תקח חלק בה. <br />לא טעיתי בפעם הראשונה שבחרתי בך. זיהיתי את היכולות שלך להקסים, לספר, להפעיל, ולכבד את הילדים בנוכחותך המרשימה. יש לך דרכים שונות ומיוחדות להפעיל את הילדים. <br />הרעיון של לשלב קסמים וסיפורים של לאה גולדברג, היה מבריק. <br />קצרה היריעה מחהכיל את כל הברכות והתודות השגורות בפי - לכן תודה שוב.  <br />', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(49, 'טל', 'חגגנו בביתנו יום הולדת 6 לבנותינו. הזמנו את יאגו הקוסם בעקבות המלצה. יום ההולדת היה נפלא! הילדים ישבו מוקסמים ומרותקים. צחקו והשתתפו. בנותינו היו במרכז יום ההולדת ונהנו מתשומת הלב שהרעיף עליהן יאגו. זהו יום הולדת המכבד את הילדים! ממליצים מכל הלב! ושוב תודה יאגו!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(50, 'עומר', 'ראיתי את יאגו ביום הולדת של בן של חברים ואחרי שגם אני, שרואה כל כמה שבועות הופעות של קוסמים כמלווה של הבן שלי, ישבתי מרותק מהקסמים המיוחדים, החלטתי לקחת אותו שערוך את יומ ההולדת של הבן שלנו שחגג את יום הולדתו ה-6. היה מדהים!!! יאגו הצליח לרתק את הילדים, לשעשע אותם ולרתק אותם עם קסמים מיוחדים, וגם הפרס שחולק בסוף היה ייחודי.<br />מומלץ בחום', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(51, 'משפחת טל', 'הכרנו את יאגו ביום הולדת אצל חברים, והילדים ואנחנו התרשמנו מאוד והחלטנו להזמינו ליום ההולדת של בננו. גם הפעם המופע היה מוצלח ביותר, מקצועי, מרשים, מפתיע ומצחיק. אנחנו וילדיי הכיתה נהנינו מאוד וזכינו לפיטבקים חיוביים מאוד מההורים, למחרת. תודה רבה ליאגו הקוסם!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(52, 'משפחת נבון', 'יאגו הקוסם הקסם גם אותנו ההורים וגם את ניר שחגג 7 ואת כל ילדי הגן. היה מקסים ונעים,  מאוד רגוע, שליו,מצחיק וחביב עם ילדים וזה מאוד חשוב. נהנו מאוד וכמובן שלא נשכח ואני בטוחה שגם שאר ההורים. תודה', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(53, 'שושי כוכב', 'ברצוני להמליץ בחום על יאגו הקוסם שהופיע אצלינו במרכז חירום.הופעתו החיצונית מרשימה ביותר איש ענק(בגובהו.) בלבוש מהאגדות שיצר רושם של קוסם אמיתי מהאגדות. ההופעה הייתה מרתקת והוא הוכיח את עצמו כמקצוען אמיתי ששולט ברזי הרזים של הקסמים.<br />הופעתו הקסימה את הילדים ולא היה בה רגע דל. הילדים במקום שבו אני עובדת נתונים למצבי רוח וקשה מאוד לעניין אותם. ובכל זאת יאגו הגיע לכל אחד ואחד מהם ברגישותו המופלאה. הייתה תחושה שהוא נתן מעבר למה שקיבל... ועל-כך תודה ענקית!!!<br />כמובן שאניחושבת להזמין אותו בשנה הבאה - הילדים לא מפסיקים לדבר עליו כבר כמה ימים...', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(54, 'דנה יצחקי', 'כבר משיחת הטלפון הראשונה עם יאגו, התרשמתי לטובה. הרגשתי שמדובר באדם טוב, לא צעקני, היודע מה הוא עושה ועושה זאת באהבה גדולה. המופע היה מקסים, הילדים היו מהופנטים אליו, אורך המופע היה מעולה  - ואפילו ארוך יותה ממה שציפיתי - במובן החיובי - זה תפר לי את כל האירוע. הילדים זכו בפרס של קסם נחמד, ויצאו עם חיוך גדול על השפתיים...וגם ההורים שלהם... פשוט קסם של מופע.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(55, 'יעל ישפה - דרעי', 'חגגנו יום הולדת 7 מהנה ומוצלחת עם ילדי הכיתה (כיתה ב). חזרנו ליאגו לאחר יום הולדת 5  שהשאירה זכרונות מתוקים אצל בני, והוא גם ביקש שוב את יאגו. <br />וגם הפעם יאגו הקסים את הילדים, הם היו מרותקים מהרגע בו נכנסו בשער ועד העוגה וגם אחרי. יאגו הקדים לבוא והפעיל את הילדים עוד לפני שעת ההתחלה והרבה אחרי הסיום. הפעילות בטוב טעם. ממליצה בחום.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(56, 'בילי', 'הגענו ליאגו דרך ההמלצות באתר זה בדיוק, ולחלוטין לא התאכזבנו: יאגו מקסים, העביר את ההופעה בהומור, ברוגע, בלי צעקות ודרמות מיותרות אך עם זאת הצליח לרתק ולהקסים את הילדים וגם את המבוגרים (שלא רצו להחמיץ אפילו רגע). אנחנו חגגנו יום הולדת 5 לבני ולחברו, והמופע התאים לגילם (וגם לגיל ההורים). הילדים היו מרותקים למופע והמבוגרים גם, למופע ולתגובות הילדים...  ממליצה בחום. ', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(57, 'אורי סלנט', 'חגגנו אתמול 20.11.2011 מסיבת יום הולדת לבננו בן ה 6.<br />אנו מאוד שמחים שבחרנו ביאגו. הבחור מאוד סימפטי, משדר רוגע. הילדים מאוד צחקו ושיתפו פעולה במשך המופע. קיבלנו בדיוק את מה שציפינו.<br />הבחור יודע איך לדבר ולגשת אל הילדים. הוא יוצר עמם קשר ומזמין איתם להשתתף.<br />מומלץ בחום. אגב, גם המבוגרים נהנו מהמופע', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(58, 'אילת', 'ביום חמישי ה-24.11 חגגנו יום הולדת לשני בני 8 ולכיתה ג,.יאגו ניהל את כל החגיגה, החל מההתכנסות, דרך הופעת הקוסמות וכלה בקסמים קטנים לילדים שנשארו בסוף. הילדים, שהיו בהתחלה קצת סקפטים , נסחפו בהופעה והתלהבו. יאגו דיבר אליהם בגובה העיניים כמו אל מבוגרים. המופע השאיר את חותמו על הילדים והם המשיכו לדבר עליו גם בבית הספר ביום למחרת. גם המבוגרים נהנו מאוד. בקיצור - מומלץ.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(59, 'מיכל ועופר', 'ב2/12/011 ערכנו מסיבה להולדת בנינו. יאגו הקוסם  ריתק בקסמיו בסבלנות אין קיץ, יצירתיות ומקצועיות 30 ילדים החל מגיל שנתיים ועד 10. הילדים נהו אחריו וסירבו לתת לו ללכת במשך 3 שעות תמימות וגם המבוגרים הסתקרנו למראה הקסמים המתוחכמים והמעניינים. מומלץ מומלץ מומלץ לקטנים ולגדולים ילדים ומבוגרים.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(60, 'משפחת ואלפיש כפר סבא', 'היום שישי 15.12 חגגנו לבתנו יום הולדת 7 עם כול הכיתה הזמננו מפעיל קוסם דרך האינטאט ולא ידענו עליו דבר יאגו הגיע והקסיפ אותנו פשוט בן אדם מקסיתים עם המון סבלנות לילדים יודע איך לדבר איתם אני הוקסמתי ממנו הוא מאמת אישית עשה קסמים שאותי בהיותי אדם מבוגר התרשתי הופתעתי הוא הגיע לפני הזמן ארדן את כול הדברים וגם אחרי הזמן נשאר לשוחח עם הילדים לראות וללמד עוד קסמים<br />תודה נכול הלב ממני מרי קרלוס נועה ודנה<br />נועה רוצה להוסיף כמה דברים ממנה-יאגו היה לי מאוד כיף אני מקוה שגם לך היה כיף אני רוצה שניהיה בקשר ממני נועה', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(61, 'בית כנסת אוהל עמנואל בנתניה', 'פשות נפלה יגו משמח את הילדים וג את המבוגרים<br />אנו מאוד ממליצים עליו לכל סוגי אירוח<br />הוא מסוגל להפטיע את כולם<br />תודה יגו', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(62, 'ליאת', 'לפני שנתיים הזמנו את יאגו ליום הולדת של הבן שחגג 8. היינו מאוד מרוצים והחלטנו להזמין אותו שוב ליום הולדת 5 של הבת הקטנה. <br />גם הפעם היה מוצלח מאוד. יאגו מתאים מאוד לילדים קטנים. כל ילד שהגיע קיבל יחס אישי וקסם אישי. <br />הרבה הורים נשארו לארוע ונהנו גם. אחת האמהות אמרה שהייתה לה "חוויה מתקנת" לעומת הופעות של מפעילים אחרים - ווליום סביר, שפה יפה, חוש הומור וקסמים פשוט טובים. <br />אנחנו ממליצים.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(63, 'נלה גורביץ''', 'חגגנו יום הולדת 6 לבננו עם יאגו הקוסם. היה נהדר. יאגו הוא איש נעים הליכות, סבלני ומצחיק. הילדים נהנו מאוד מההופעה, וגם ההורים צפו בכיף. ההופעה מצחיקה, מרתקת והכל נעשה בטוב טעם.<br />גם לאחר ההופעה הייתה ליאגו סבלנות לדבר עם כל ילד שבא לשאול שאלות.<br />כולנו נהנינו וממליצים על יאגו הקוסם בחום!<br /><br />המון תודה<br /><br />נלה', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(64, 'שירה', 'חגגנו יום הולדת 6 לילדנו התאומים, והזמנו את יאגו מאחר והם מבקשים קוסם כבר מיום ההולדת בשנה שעברה...<br />היה נפלא, הילדים היו מרותקים, המבוגרים נהנו, הכל התנהל בשקט יחסי (עם 30 בני 6 בתוך הבית זה לא מובן מאליו). וקיבלנו אח"כ פידבקים נהדרים מהורים שלא היו, שהילדים חזרו הביתה נפעמים.<br />בקיצור- ממולץ בחום רב!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(65, 'שרון', 'חגגנו לנבו יומולדת 6 ביער. נבו צפה ביאגו במסיבת יומולדתו של חבר וחזר כולו נפעם:"אמא זה הקוסם הכי טוב שראיתי מימיי!". מעולם לא הזמנו קודם מפעיל ליום ההולדת של בננו. נכנענו, הזמנו את יאגו  ו... הבנו את התלהבותו של נבו: יאגו הוא קוסם שמכבד את קהל היעד (הילדים) מחד ואת המקצוע מאידך. הוא נעים הליכות ונותן הפעלה איכותית במיוחד והכל מתובל בטוב טעם: חוש הומור, רוגע, תכנים וfun. גדולים כקטנים נהנו מאוד. מומלץ בחום!!!!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(66, 'ענת', 'חגגנו לאביב יום הולדת 6. יום ההולדת עם יאגו היה מקסים. הילדים היו מרותקים, צחקו כל העת ביחד עם המבוגרים. יאגו איש נעים הליכות משרה רוגע ומקצועי ביותר. ביום שלמחרת הילדים בגן סיפרו שיום ההולדת היתה "הכי כיפית ומצחיקה" וכמובן שאביב נהנה ביותר. ישר כח, תודה יגו. ובקצור מומלץ בחום.', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(67, 'נועה ', 'יאגו הקוסם מומלץ ביותר!!!<br /> יאגו הקוסם הצליח לרתק, לסקרן, ולהצחיק חבורה גדולה של ילדים!! (ומבוגרים.. שהתרשמו מאוד  מהאופי הרגוע והשלו שלו והדרך שלו המיוחדת כל כך להגיע אל כל אחד...).<br />האופן שבו ניכנס יאגו הביתה ומיד גרם לבן שלי ולחברו הטוב להרגיש שזהו היום המיוחד שלהם והם במרכז .<br />אהבתי את הדרך שלו להגיע לילדים, בגובה העיניים, את העכבר... התוכי ושאר השותפים שלו למופע....צחקנו ונהננו מאוד.<br />תודה על הסבלנות המדהימה שלך..  <br />תודה רבה על הכל <br />נועה והמשפחה', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(68, 'עידית', 'ליום ההולדת 7 של בתי הזמנו את יאגו הקוסם. יאגו הצליח לרתק את כל הילדים, להצחיק ולעניין. כל זה מהרגע שהוא רק נכנס בדלת...<br />כל משך ההופעה הילדים ישבו מרותקים (לא פשוט לקבוצה גדולה של ילדים) והוא גם נתן להם לעשות קסמים, דבר שרק הגביר את העניין. הילדים וגם הגדולים נהנו!<br />תודה על האירוע המוצלח, תודה על היחס המיוחד לבתי ועל שהגשמת לה חלום<br />מומלץ, מומלץ, מומלץ,<br />עידית', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL),
(69, 'יהודית (כוכב יאיר)', 'איזה אדם מדהים הוא עמי הלא הוא יאגו הקוסם!<br />הזמנו אותו ליום הולדת של שלושה בנים בני 8, האמת בהתחלה דאגנו כי בגיל הזה הכיתה כבר מתוחכמת ואולי תשתעמם אבל יאגו ממש הקסים את כולם!<br />כולם ישבו מרותקים אליו, הוא הצחיק אותם, עניין אותם בטירוף, הוא כ"כ טוב  עם ילדים!!!<br />מאוד נהנינו, תודה רבה!', 1, NULL, NULL, NULL, NULL, '2012-07-19 16:29:29', NULL, NULL, NULL, NULL);
